import s from './ErrorPage.module.css';
import errorImg from '../../assets/img/error.jpg';

const ErrorPage = () => {
	return (
		<div className={s.error}>
			<div className={s.error_container}>
				<img className={s.error_img} src={errorImg} alt="" />
				<div className={s.error_row}>
					<div className={s.error_block}>
						<p>Сторінки може не істувати, поверніться на Головну</p>
						<a className="standart-btn" href="/">
							Головна
						</a>
					</div>
					<div className={s.error_block} style={{ marginTop: '20px' }}>
						<p>Або спробуйте Вийти з облікового запису та повторити Вхід</p>
						<a className="standart-btn cancel" href="/">
							Вийти
						</a>
					</div>
				</div>
			</div>
		</div>
	);
};

export default ErrorPage;
